import{_ as t,c as r,aI as a,o as n}from"./chunks/framework.b7dag8kZ.js";const o="/metaeditor/onnx_view.png",i="/metaeditor/onnx_netron.png",_=JSON.parse('{"title":"使用机器学习模型","description":"","frontmatter":{"head":[["link",{"rel":"canonical","href":"https://vite.dev/metaeditor/other/machine_learning"}],["meta",{"property":"og:title","content":"使用机器学习模型"}]]},"headers":[],"relativePath":"metaeditor/other/machine_learning.md","filePath":"metaeditor/other/machine_learning.md","lastUpdated":1744293048000}'),l={name:"metaeditor/other/machine_learning.md"};function p(d,e,h,m,c,s){return n(),r("div",null,e[0]||(e[0]=[a('<h1 id="使用机器学习模型" tabindex="-1">使用机器学习模型 <a class="header-anchor" href="#使用机器学习模型" aria-label="Permalink to &quot;使用机器学习模型&quot;">​</a></h1><p>MQL5语言支持 <a href="https://ru.wikipedia.org/wiki/ONNX" target="_blank" rel="noreferrer">ONNX</a> (开放式神经网络交换)模型的操作。ONNX是一种机器学习模型的开源格式。这种格式得到多个平台的支持，包括 <a href="https://chainer.org/" target="_blank" rel="noreferrer">Chainer</a>,<a href="https://caffe2.ai/" target="_blank" rel="noreferrer">Caffee2</a> 和 <a href="https://pytorch.org/" target="_blank" rel="noreferrer">PyTorch</a>。使用专门的工具创建ONNX模型，将其整合到您的MQL5应用程序，并使用它来做出交易决策。所有支持功能的描述都在 <a href="https://www.mql5.com/zh/docs/onnx" target="_blank" rel="noreferrer">MQL5文档</a>中提供。</p><h2 id="在metaeditor中查看模型" tabindex="-1">在MetaEditor中查看模型 <a class="header-anchor" href="#在metaeditor中查看模型" aria-label="Permalink to &quot;在MetaEditor中查看模型&quot;">​</a></h2><p>你可以直接在编辑器中查看ONNX模型文件(*.onnx)的内容。例如，在 <a href="/metaeditor/mql5storage/projects#public">Toolbox / Public Projects</a> 下找到项目ONNX.Price.Prediction并在快捷菜单中选择加入。该项目将下载到您的计算机并显示在导航器中。</p><p><img src="'+o+'" alt="在MetaEditor中直接打开ONNX模型"></p><h2 id="netron" tabindex="-1">Netron <a class="header-anchor" href="#netron" aria-label="Permalink to &quot;Netron&quot;">​</a></h2><p><a href="https://github.com/lutzroeder/netron" target="_blank" rel="noreferrer">Netron</a> 中的视图模型是ML模型的专用查看器，可以方便地查看其内容。该查看器支持多种流行模型，包括ONNX、TensorFlow Lite、Caffe、Keras和ncnn等。</p><p>要查看模型，请在导航器中选择其文件并单击“在Netron中打开”。如果未安装此实用程序，将打开其 <a href="https://github.com/lutzroeder/netron/releases" target="_blank" rel="noreferrer">GitHub页面</a> ，您可以根据您的操作系统从中下载相关安装程序。例如，使用适用于Windows的Netron-Setup-XXXexe。如果程序已安装，模型将立即打开，以便从导航器中查看。</p><p><img src="'+i+'" alt="使用Netron可视化机器学习模型"></p><p>支持的格式：</p><ul><li>armnn, caffemodel, circle, ckpt, cmf, dlc, dnn, h5, har, hd5, hdf5, hn, keras, kmodel,</li><li>lite, mar, meta, mge, mlmodel, mlnet, mlpackage, mnn, model, nb, ngf, nn, nnp,</li><li>om, onnx, ort, paddle, param, pb, pbtxt, pdiparams, pdmodel, pdopt, pdparams, prototxt, pt, pth, ptl,</li><li>rknn, t7, tfl, tflite, tmfile, tm, tnnproto, torchscript, uff, xmodel</li></ul>',11)]))}const g=t(l,[["render",p]]);export{_ as __pageData,g as default};
